import React from 'react';
import './style.css'

const AddPlaylistBox = ({status, handleAddBox}) => {
    return (
        <div>
            <input type="text" className={`${status}`} onChange={(e) => handleAddBox(e)}>
            </input>
            <button>+</button>
        </div>
    );
};

export default AddPlaylistBox;
